"EditorSettings|What Are Cookies?":[ "\xbfQu\xe9 son las cookies?" ],
"EditorSettings|Cookies are bits of information (memory files) stored in your browser by sites you visit. As is common practice with almost all websites, this site uses cookie to improve your experience by remembering your preferences and enable other cookie-based features (e.g. analytics).":[ "Las cookies son fragmentos de informaci\xf3n (archivos de memoria) almacenados en tu navegador por los sitios que visita. Como es pr\xe1ctica com\xfan con casi todos los sitios web, este sitio utiliza cookies para mejorar tu experiencia al recordar tus preferencias y habilitar otras caracter\xedsticas basadas en cookies (por ejemplo, an\xe1lisis)." ],
"EditorSettings|Our Cookies":[ "Nuestras cookies" ],
"EditorSettings|When you submit data through a form such as those found on contact pages or comment forms, cookies may be set to remember your user details for future correspondence.":[ "Al enviar datos a trav\xe9s de un formulario, como los que se encuentran en las secciones de contacto o formularios, las cookies puede que se utilicen para recordar tus datos de usuario para futuras coincidencias. " ],
"EditorSettings|In order to provide you with a better experience and remember your preferences, we need to set cookies so that this information can be called whenever you interact with a page.":[ "Con el fin de ofrecerte una mejor experiencia y recordar tus preferencias, necesitamos establecer cookies que registren tu actividad cada vez que interact\xfaas con una p\xe1gina." ],
"EditorSettings|Third-Party cookies":[ "Las cookies de terceros" ],
"EditorSettings|In special cases, we also use cookies provided by trusted third parties like Google Analytics. Third party analytics are used to track and measure usage of this site so that we can continue to produce engaging content.":[ "En casos especiales, tambi\xe9n utilizamos cookies proporcionadas por terceros de confianza como Google Analytics. An\xe1lisis de terceros son utilizados para rastrear y medir el uso de este sitio para que podamos seguir produciendo contenido atractivo." ],
"EditorSettings|How To Disable Cookies?":[ "\xbfC\xf3mo desactivar las cookies?" ],
"EditorSettings|Most browsers let you to refuse to accept cookies. See your browser Help or Tool for how to do this. Be aware that disabling cookies may affect the functionality of this and many other websites you visit. Therefore, it is recommended that you do not disable cookies.":[ "La mayor\xeda de los navegadores permiten que te niegues a aceptar cookies. Consulta en las herramientas de tu navegador para saber c\xf3mo hacer esto. Ten en cuenta que desactivar las cookies puede afectar la funcionalidad de \xe9ste y muchos otros sitios web que visites. Por lo tanto, se recomienda que no desactives las cookies." ],
